import React from 'react';

function BasketItem({ item }) {
    return (
        <div className="basket-item">
            <p>{item.name}</p>
            <p>{item.selectedOption}</p>
            <p>{item.quantity}</p>
            <p>{item.totalPrice}</p>
        </div>
    );
}

export default BasketItem;
